import React, { Component } from 'react';



class Form extends Component {
    constructor(){
        super()
        this.state ={
            username : '',
        }

    }
    
    render() { 
        return (
            <div>
               <form>
                   <div>
                        <label>username</label>
                        <input type='text' value ={this.state.username} />
                   </div>
               </form>
            </div>
          );
    }
}
 
export default Form ;
